svg.script:
var DrawPaths = new function()
{
  var l;
  var increment;
  var len;
  var idx=0;
  var paths;
  var node;
  var style;

  window.addEventListener("load", init);

  function init()
  {
    setTimeout(initialize,1000);
  }

  function initialize()
  {
    paths = document.getElementsByTagName("path");
    for(var i=0;i<paths.length;i++)
    {
      style = paths[i].getAttribute("style");
      paths[i].setAttribute("style","display:none;"+style);
    }
    getPath();
  }

  function getPath()
  {
    if(idx>paths.length) return;

    node = paths[idx];
    style = node.getAttribute("style");
    len = node.getTotalLength();

    increment=len/100;
    if(increment<10) increment = 10;
    l = increment;

    setTimeout(drawPath,500);
  }

  function drawPath()
  {
    node.setAttribute("style","fill:none;stroke:magenta;stroke-width:2px;stroke-dasharray:"+l+","+len);
    l+=increment;
    if(l<len) setTimeout(drawPath,75);
    else
    {
      style = style.replace("display:none;","");
      node.setAttribute("style",style);
      idx++;
      setTimeout(getPath,50);
    }
  }
}();
